    'translation' => 'Guiden uppgraderar inte från tidigare versioner av eZ Publish (som 2.2.7) om du lämnar datan som den är. Detta gäller bara för dem som har befintlig data som de vill bevara. Om du har befintlig data i eZ Publish 4.0 (t.ex. från en RC-utgåva) bör du hoppa över db-initialiseringen. Du måste emellertid då göra en manuell uppgradering.',
